import React from "react";
import "../home/Home.css";
import {
    Button, Modal, ModalFooter,
    ModalHeader, ModalBody
} from "reactstrap"

export default function Home() {
    const [modal, setModal] = React.useState(false);
    const toggle = () => setModal(!modal);


    const signIn =()=>{
        console.log("t")
        return(
            <SignIn/>
        )
    }
    return ( <>
        <div id = 'landing-con' >
            <div>
                <img src = { require('../../assets/Group 4.png').default}/> 
                <h1 > source of<br/> intelligence </h1> 
                <p> Sign - up and receive unlimited accesss to all of your literatur - share your literature. </p> 
                <div>
                    <button  id='btn-signUp'>Sign Up</button>
                    <button onClick={signIn} id='btn-signIn'>Sign In</button>
                </div>
            </div>
            <img id="img-landing" src = {require('../../assets/g12.png').default }/> 
        </div> 
        </>
    )
    function SignIn(){
        <div style={{ display: 'block', width: 700, padding: 30}}>
            <h4>ReactJS Reactstrap Modal Component</h4>
            <Button color="primary"
                onClick={toggle}>Open Modal</Button>
            <Modal isOpen={modal}
                toggle={toggle}
                modalTransition={{ timeout: 2000 }}>
                <ModalBody>
                    Simple Modal with just ModalBody...
                </ModalBody>
            </Modal>
        </div >
        }
    }
